import React from 'react';

import './app.css';

const App = () => {
	return (
		<div className="wrApp">
			<div className="currencyBlock wrBaseCurrency">
				<input type="text" className="baseCurrency" />
				<span className="currencyCode1">UA</span>
			</div>
			<div className="currencyBlock wrConvertedCUrrency">
				<span className="currencyCode2">USA</span>
				<input type="text" className="convertedCurrency" />
			</div>
		</div>
	);
};

export default App;
